    def System_Start(self):
        if self.Radio_RunningMode.isChecked() == True:
            self.Main_Thread.RunningState = 'Offline'
        else:
            self.Main_Thread.RunningState = 'Online'
        self.Main_Thread.path = self.Line_Edit_Path.text()
        self.Main_Thread.start()

    def System_Stop(self):
        self.Main_Thread.terminate()                                   # Kill Calibration Process
        self.printConsole('Process Canceled.')
        self.pushButton_Stop.setEnabled(False)                      # Buttons State
        self.Button_Start.setEnabled(True)                          # Buttons State
        self.pushButton_Browse.setEnabled(True)                     # Buttons State

    def Browse_path(self):
        dialog = QtWidgets.QFileDialog()                                # Open Windows explorer
        path = dialog.getExistingDirectory(self.centralwidget, "Select Directory")
        self.Line_Edit_Path.setText(path)

    def IsRunning(self, result):
        self.pushButton_Stop.setEnabled(result)                   # Buttons State
        self.Button_Start.setDisabled(result)                     # Buttons State
        self.pushButton_Browse.setDisabled(result)                # Buttons State

    def Radio_Button_Set(self):
        if self.Radio_RunningMode.isChecked() == True:
            self.Radio_RunningMode.setText('Offline')
        else:
            self.Radio_RunningMode.setText('Online')

    def printConsole(self, result):
        self.textBrowser.append(result)

    def setPhoto1(self, img):
        img = imu.resize(img, width=256)
